@import url('https://fonts.googleapis.com/css2?family=Roboto:wght@100;300;400;500;700;900&display=swap');

body {
    padding: 0px;
    margin: 0px;
    font-family: 'Roboto', sans-serif;
}

#footercontainer {
    max-width: 100%;
    height: 300px;
    /* background-color: #D6E7EE; */
    background-color: #01122f;
    /* background-color: #b3c8d1; */
    display: flex;
    align-items: start;
    justify-content: center;
    gap: 30px;
    /* padding: 50px 80px 50px 80px; */
    /* box-shadow: 2px 2px 11px 5px #90cde988 inset; */
    margin: 0px;
    border-top: 4px solid #01122f;
    font-size: 62.5%;
}

#footeraboutus {
    flex: 2 1 0;
    color: #001B48;
}

.footerhead-div {
    display: flex;
    align-items: center;
    justify-content: start;
    gap: 10px;
}

#footeraboutus img {
    width: 80px;
    height: 80px;
    object-fit: contain;
    background-color: aliceblue;
    border-radius: 100px;

}

.footerhead {
    font-size: 40px;
    padding: 0px;
    margin: 0px;
    font-weight: 800;
    color: aliceblue;
}

.footerpara1 {
    font-size: 20px;
    font-weight: 600;
    color: #018ABE;
    margin: 10px 0 5px 0;
}

.footerpara2 {
    font-size: 16px;
    color: aliceblue;
    text-align: justify;
}

#footerquicklinks {
    flex: 1 1 0;
    padding: 0px 0px 0px 100px;
    margin: 0px;
    font-size: 62.5%;

}

#footerquicklinks p {
    font-size: 20px;
    font-weight: 600;
    color: #018ABE;
    padding-left: 30px;
}

#footerquicklinks ul {
    list-style: none;
    font-size: 1rem;
}

#footerquicklinks a {
    text-decoration: none;
    /* color: #001B48; */
    color: aliceblue;
}

#footerquicklinks a:hover {
    color: #018ABE;
}

#footerfollowus {
    flex: 1 1 0;
    margin: 0px;
    padding: 0px;
}

#footerfollowus p {
    font-size: 20px;
    font-weight: 600;
    color: #018ABE;
}

.footerfollowus-div {
    display: flex;
    gap: 10px;
}

#footercontactus {
    list-style: none;
    margin: 0px;
    padding: 0px;
}

#footercontactus p {
    font-size: 20px;
    font-weight: 600;
    color: #018ABE;
    position: relative;
    left: 35px;
}

#footercontactus ul {
    list-style: none;
    /* color: #001B48; */
    color: aliceblue;
    font-size: 16px;
}

#footercontactus li {
    padding-left: 2px;
}
